    -- <summary>
    -- Get a vehicle model from the model name as a string, instantiated as the right model class
    -- </summary>
    -- <returns>The Vehicle model, instantiated as the right model class</returns>
    FromName = function (name)
      return FromId(SlipeMtaDefinitions.MtaShared.GetVehicleModelFromName(name))
    end
    -- <summary>
    -- Get a vehicle model from its ID, instantiated as the right model class
    -- </summary>
    -- <returns>The Vehicle model, instantiated as the right model class</returns>
    FromId = function (id)
      if Linq.Contains(SlipeSharedVehicles.SharedVehicleModel.boatModels, id) then
        return SlipeServerVehicles.BoatModel(id)
      end
      if Linq.Contains(SlipeSharedVehicles.SharedVehicleModel.planeModels, id) then
        return SlipeServerVehicles.PlaneModel(id)
      end
      if Linq.Contains(SlipeSharedVehicles.SharedVehicleModel.helicopterModels, id) then
        return SlipeServerVehicles.HelicopterModel(id)
      end
      if Linq.Contains(SlipeSharedVehicles.SharedVehicleModel.trailerModels, id) then
        return SlipeServerVehicles.TrailerModel(id)
      end
      if Linq.Contains(SlipeSharedVehicles.SharedVehicleModel.trainModels, id) then
        return SlipeServerVehicles.TrainModel(id)
      end
      if Linq.Contains(SlipeSharedVehicles.SharedVehicleModel.turretedModels, id) then
        return SlipeServerVehicles.TurretedModel(id)
      end
      if Linq.Contains(SlipeSharedVehicles.SharedVehicleModel.taxiModels, id) then
        return SlipeServerVehicles.TaxiModel(id)
      end

      return class(id)
    end
